import Video from "../video/Video";

const ModalApp = () => {
  return (
    <div className="overlay">
      <div className="popup">
        <i class="far fa-times-circle" onClick={<CerrarModal />}></i>
        <Video />
      </div>
    </div>
  );
};
export default ModalApp;
